    [],nt"revision_timestamp": "2016-07-27T22:57:58.342527",nt"name": "preliminary-biotic-survey-of-cane-creek-calhoun-county-al",nt"isopen":
    false,nt"url": null,nt"notes": "A biotic survey of Cane Creek (Calhoun
    County, AL) was completed in the Fall (1992) and Winter (1993) at six sites within
    Cane Creek to determine the effects of seasonal change on the general water quality
    of the stream with respect to various water quality parameters, mainly water chemistry
    and benthic macroinvertebrate fauna. In addition to water quality sampling, soil
    tests were also conducted to delineate any wetland regions near the six sites in
    question. Fish were collected using electro-fishing techniques at 2 sites (sites
    2 and 3). Mollusk surveys were also conducted in Cane Creek to determine presence/absence
    of mollusk species including the endangered (Tulatoma magnifica). Report includes
    data sheets and lists of species encountered (at end of report).",nt"license_title":
